// src/components/Header.js
import React from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import { Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "../pages/css/App.css";

const Header = () => {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" className="retro-navbar">
      <Container>
        {/* Navbar Brand */}
        <Navbar.Brand as={Link} to="/" className="retro-title">
          Larson Evans
        </Navbar.Brand>

        {/* Hamburger Button (Bootstrap Controlled) */}
        <Navbar.Toggle aria-controls="basic-navbar-nav" />

        {/* Collapsible Navbar Content */}
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            {/* Navigation Links */}
            <Nav.Link as={Link} to="/resume" className="retro-link">
              Resume
            </Nav.Link>
            <Nav.Link as={Link} to="/portfolio" className="retro-link">
              Portfolio
            </Nav.Link>
            <Nav.Link as={Link} to="/contact" className="retro-link">
              Contact
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
